INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (1, 'Tarte aux choux', 'antonin', , 'La recette est très bien', '2023-05-22', 'tarte, chou, legume', 'pâte à tarte, choux, crème, beurre, sel', 'La tarte aux choux est une délicieuse pâtisserie qui marie la légèreté des choux à une base de tarte croustillante. Pour la préparer, vous commencerez par préparer une pâte à tarte maison en mélangeant de la farine, du beurre et une pincée de sel. Pétrissez la pâte jusqu''à obtenir une consistance lisse, puis étalez-la dans un moule à tarte. Pendant ce temps, préparez la garniture en cuisant les choux dans de l''eau bouillante salée jusqu''à ce qu''ils soient tendres. Coupez les choux en morceaux et mélangez-les avec une sauce crémeuse à base de crème, de lait, d''œufs, de sel et de poivre. Versez délicatement la garniture sur la pâte à tarte et assurez-vous de bien la répartir. Ensuite, faites cuire la tarte au four préchauffé jusqu''à ce que la croûte soit dorée et que la garniture soit ferme. Vous pouvez servir cette tarte aux choux chaude ou froide, selon vos préférences.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (2, 'Pizza au chocolat', 'johnsmith89', , 'Une pizza sucrée à la croûte croustillante garnie de chocolat fondu, de morceaux de chocolat, de fruits et de noix pour une expérience dessert délicieusement inhabituelle.', '2017-06-12', 'pizza, choco, tomate, chocolat', 'pâte à pizza, chocolat fondu, morceaux de chocolat, fraises, amandes', 'La pizza au chocolat est une gourmandise sucrée qui offre une combinaison irrésistible de pâte moelleuse et de chocolat fondant. Pour commencer, préparez une pâte à pizza sucrée en mélangeant de la farine, de la levure, du sucre, du sel et de l''eau tiède. Pétrissez la pâte jusqu''à obtenir une consistance élastique, puis laissez-la reposer et lever pendant environ une heure. Une fois la pâte prête, étalez-la en forme de cercle sur une plaque à pizza. Ensuite, étalez généreusement une couche de pâte à tartiner au chocolat sur la pâte à pizza. Choisissez votre pâte à tartiner préférée, qu''il s''agisse de chocolat noir, au lait ou même de pâte à tartiner aux noisettes. Ensuite, ajoutez des morceaux de chocolat de votre choix, des fruits secs ou des noix pour ajouter de la texture et de la saveur à la pizza. Enfournez la pizza dans un four préchauffé et laissez-la cuire jusqu''à ce que la croûte soit dorée et que le chocolat soit fondant. Sortez la pizza du four et laissez-la légèrement refroidir avant de la découper en parts et de la déguster.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (3, 'Sushi pizza', 'emilyjones92', , 'Une fusion créative entre les sushis japonais et la pizza italienne, cette recette combine une base de riz sushi croustillante avec des garnitures de poisson cru, d''avocat, de concombre et de sauce soja.', '2016-09-25', 'pizza, sushi, riz, tomate, poisson', 'riz sushi, sauce soja, poisson cru, avocat, concombre', 'La sushi pizza est une fusion créative entre la cuisine japonaise et italienne. Pour préparer cette délicieuse recette, vous aurez besoin de riz à sushi, d''algue nori, de garnitures de sushi et d''assaisonnements. Commencez par cuire le riz à sushi selon les instructions de cuisson habituelles et ajoutez-y du vinaigre de riz, du sucre et du sel pour lui donner une saveur authentique. Pendant que le riz refroidit légèrement, préparez la base de la pizza en étalant une feuille d''algue nori sur une plaque de cuisson. Étalez uniformément le riz sur l''algue nori en pressant légèrement pour le compacter. Ensuite, ajoutez les garnitures traditionnelles de sushi comme des tranches de saumon cru, d''avocat, de concombre et de gingembre mariné. Vous pouvez également incorporer des ingrédients de votre choix, tels que des crevettes cuites, des dés de thon ou des légumes croquants. Pour ajouter de la saveur, saupoudrez des graines de sésame ou d''autres assaisonnements sur le dessus. Enfin, découpez la sushi pizza en parts et servez-la comme une pizza traditionnelle. Vous pouvez accompagner votre sushi pizza de sauce soja et de wasabi pour une expérience gustative complète.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (4, 'Glace à la pizza', 'davidwilson77', , 'Un mélange surprenant entre la douceur de la crème glacée et la saveur salée de la pizza. Imaginez une crème glacée à la tomate avec des morceaux de croûte de pizza croustillante et des garnitures de votre choix.', '2021-03-08', 'glace, pizza, tomate', 'glace à la vanille, sauce tomate, croûte de pizza, garnitures de pizza', 'La glace à la pizza est une création audacieuse qui marie des saveurs salées et sucrées dans un dessert unique. Pour préparer cette glace délicieusement inhabituelle, vous aurez besoin de crème glacée à la vanille et de morceaux de pâte à pizza cuite et refroidie. Commencez par faire cuire la pâte à pizza selon votre recette habituelle, en veillant à obtenir une texture croustillante. Laissez refroidir la pâte et coupez-la en petits morceaux. Dans un grand bol, mélangez la crème glacée à la vanille avec les morceaux de pâte à pizza, en veillant à bien les répartir. Vous pouvez également ajouter des ingrédients de pizza classiques pour intensifier les saveurs, tels que du fromage râpé, des morceaux de pepperoni et de la sauce tomate. Mélangez délicatement pour que tous les ingrédients soient bien incorporés. Transférez ensuite le mélange dans un récipient adapté à la congélation et placez-le au congélateur pendant plusieurs heures, voire toute la nuit, jusqu''à ce que la glace soit ferme. Lorsque la glace à la pizza est prête, servez-la en boules dans des cornets ou des coupes. Laissez vos invités découvrir l''excitation de déguster une glace à la fois salée et sucrée.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (5, 'Tacos au petit-déjeuner', 'sarahbrown88', , 'Un petit-déjeuner hors du commun où les tortillas de maïs sont garnies d''œufs brouillés, de bacon croustillant, de fromage fondu, de salsa et de guacamole pour une expérience matinale savoureuse et originale.', '2018-11-19', 'tacos, viande, frite, calorie, petit déjeuner', 'tortillas de maïs, oeufs brouillés, bacon, fromage râpé, salsa', 'Les tacos au petit-déjeuner sont une façon savoureuse de commencer la journée avec une explosion de saveurs. Pour préparer ces tacos, vous aurez besoin de tortillas de maïs ou de farine, de bacon croustillant, d''œufs brouillés et de garnitures au choix. Commencez par faire cuire le bacon jusqu''à ce qu''il soit croustillant, puis retirez-le de la poêle et égouttez-le sur du papier absorbant. Dans la même poêle, préparez des œufs brouillés en battant des œufs avec une pincée de sel et de poivre. Faites cuire les œufs jusqu''à ce qu''ils soient légèrement brouillés et crémeux. Pendant ce temps, réchauffez les tortillas dans une autre poêle ou au four pour les rendre chaudes et souples. Pour assembler les tacos, placez une généreuse quantité de bacon croustillant et d''œufs brouillés sur chaque tortilla. Ajoutez ensuite vos garnitures préférées, telles que du fromage râpé, des tranches d''avocat, de la salsa ou de la coriandre fraîche. Pliez les tortillas en forme de tacos et servez-les immédiatement pour profiter de la chaleur et des saveurs délicieuses du petit-déjeuner.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (6, 'Gâteau de viande surprise', 'alexanderdavis91', , 'Un gâteau de viande classique avec une touche inattendue. Il est farci de fromage fondant, de légumes et de sauce pour une délicieuse surprise au cœur de chaque tranche.', '2019-05-03', 'gateau, viande, surprise, farine, oeuf', 'viande hachée, fromage, légumes variés, sauce tomate', 'Le gâteau de viande surprise est une création amusante qui mélange les textures et les saveurs pour une expérience culinaire unique. Pour préparer ce gâteau, vous aurez besoin d''un mélange de viandes hachées, de légumes, de fromage et d''assaisonnements. Commencez par mélanger différentes viandes hachées, comme du bœuf et du porc, avec des légumes finement coupés, tels que des carottes, des oignons et des champignons. Ajoutez des assaisonnements tels que de l''ail, du persil, du sel et du poivre pour rehausser les saveurs. Mélangez tous les ingrédients jusqu''à obtenir une consistance homogène. Pour ajouter une surprise, créez un creux au centre du mélange de viande et remplissez-le de fromage râpé ou de morceaux de fromage à pâte molle. Refermez le creux en pressant délicatement la viande autour du fromage pour le sceller. Placez ensuite le mélange de viande dans un moule à gâteau préalablement graissé et tassez-le fermement pour lui donner la forme d''un gâteau. Enfournez le gâteau de viande jusqu''à ce qu''il soit bien cuit et doré. Laissez-le reposer quelques minutes avant de le démouler et de le servir. Lorsque vous découpez une part de gâteau de viande, le fromage fondu à l''intérieur se dévoile, ajoutant une surprise savoureuse à chaque bouchée.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (7, 'Pâtes à l''encre de seiche', 'jenniferthompson84', , 'Des pâtes noires faites avec de l''encre de seiche, qui ajoutent une teinte sombre et une saveur légèrement marine aux plats de pâtes traditionnels.', '2020-08-17', 'pates, encre, seiche, noir, parmezan', 'pâtes à l''encre de seiche, huile d''olive, ail, parmesan', 'Les pâtes à l''encre de seiche sont un plat visuellement impressionnant et délicieux qui tire sa couleur noire caractéristique de l''encre de seiche. Pour préparer ces pâtes, vous aurez besoin de pâtes à l''encre de seiche fraîches ou sèches, ainsi que d''une sauce savoureuse à base d''encre de seiche. Commencez par faire bouillir de l''eau salée dans une grande casserole, puis ajoutez les pâtes à l''encre de seiche. Faites cuire les pâtes selon les instructions du paquet jusqu''à ce qu''elles soient al dente. Pendant ce temps, préparez la sauce en faisant fondre du beurre dans une poêle, puis ajoutez de l''ail émincé et faites-le revenir légèrement. Ajoutez ensuite l''encre de seiche et mélangez bien pour obtenir une sauce homogène. Si vous le souhaitez, vous pouvez également ajouter de la crème ou du bouillon de poisson pour enrichir la sauce. Lorsque les pâtes sont cuites, égouttez-les et ajoutez-les à la poêle avec la sauce. Mélangez délicatement pour enrober les pâtes de la sauce à l''encre de seiche. Servez les pâtes à l''encre de seiche chaudes, accompagnées de fruits de mer, de légumes grillés ou de parmesan râpé pour une expérience culinaire exceptionnelle.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (8, 'Banane au bacon', 'matthewrobinson95', , 'Une combinaison audacieuse de saveurs sucrées et salées, où les bananes sont enrobées de tranches de bacon et grillées pour obtenir un mélange délicieux de croustillant et de fondant.', '2015-12-29', 'banane, bacon', 'bananes, tranches de bacon, sirop d''érable', 'La banane au bacon est une combinaison surprenante mais délicieuse de saveurs sucrées et salées. Pour préparer ce mets, vous aurez besoin de bananes mûres et de tranches de bacon. Commencez par éplucher les bananes et coupez-les en deux dans le sens de la longueur. Enveloppez chaque moitié de banane avec une tranche de bacon, en veillant à bien la fixer. Vous pouvez utiliser des cure-dents pour maintenir le bacon en place si nécessaire. Faites chauffer une poêle à feu moyen et ajoutez les bananes enveloppées de bacon. Faites-les cuire pendant quelques minutes de chaque côté jusqu''à ce que le bacon soit croustillant et doré. La chaleur de la cuisson va ramollir les bananes et les rendre légèrement sucrées. Une fois que le bacon est bien cuit, retirez les bananes de la poêle et égouttez-les sur du papier absorbant pour enlever l''excès de graisse. Servez les bananes au bacon chaudes en entrée ou en accompagnement pour un mariage unique de textures et de goûts.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (9, 'Hot dog sushi', 'olivialopez87', , 'Une version décalée des sushis traditionnels, où des saucisses de hot dog remplacent le poisson cru, enroulées dans du riz vinaigré et des algues nori, et garnies de condiments tels que la moutarde et le ketchup.', '2022-02-14', 'hot, dog, hot dog, sushi, poisson, riz, saucisse', 'saucisse de hot dog, riz vinaigré, algues nori, moutarde, ketchup', 'Le hot dog sushi est une variation créative des sushis traditionnels, qui combine les saveurs d''un hot-dog avec la présentation et la technique du sushi. Pour préparer ces sushis hors du commun, vous aurez besoin de feuilles d''algue nori, de riz à sushi, de saucisses à hot-dog et de garnitures au choix. Commencez par faire cuire les saucisses à hot-dog selon les instructions du paquet, puis coupez-les en deux dans le sens de la longueur. Préparez ensuite le riz à sushi en le cuisant avec du vinaigre de riz, du sucre et du sel pour obtenir une texture et une saveur authentiques. Étalez une feuille d''algue nori sur une natte en bambou et répartissez une fine couche de riz sur toute la surface de l''algue. Placez une demi-saucisse à hot-dog sur le riz et ajoutez les garnitures de votre choix, telles que de la mayonnaise, de la moutarde, des oignons frits ou des cornichons. Roulez l''algue nori avec précaution en serrant bien pour former un rouleau de sushi compact. Répétez le processus avec le reste des ingrédients. Lorsque tous les rouleaux sont prêts, coupez-les en tranches d''environ un centimètre d''épaisseur pour révéler les couches de riz, de nori et de hot-dog. Servez les hot dog sushi avec de la sauce soja, du wasabi et du gingembre mariné pour une expérience de dégustation amusante et délicieuse.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (10, 'Poulet au cola', 'williamharris93', , 'Une recette intrigante où le poulet est cuit dans une sauce à base de cola, ce qui lui confère une tendreté et une saveur sucrée surprenantes.', '2017-10-07', 'poulet, cola, coca, viande, cuisse, sucre sale', 'poulet, cola, sauce soja, sucre brun', 'Pour préparer le poulet au cola, commencez par faire mariner des morceaux de poulet dans un mélange de cola, de sauce soja, d''ail émincé et de gingembre râpé. Laissez le poulet mariner pendant au moins une heure pour permettre aux saveurs de se mélanger. Ensuite, vous avez plusieurs options pour la cuisson : vous pouvez faire griller le poulet sur un barbecue, le cuire au four ou le faire sauter dans une poêle jusqu''à ce qu''il soit bien cuit et légèrement caramélisé. Pendant que le poulet cuit, prenez la marinade restante et faites-la réduire dans une casserole jusqu''à ce qu''elle épaississe légèrement pour créer une délicieuse sauce. Nappez le poulet de cette sauce réduite et servez-le avec des légumes sautés ou du riz pour accompagner cette combinaison aigre-douce et savoureuse.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (11, 'Spaghetti Carbonara', 'johnsmith89', , 'Un plat italien classique de pâtes avec des œufs, du fromage, du bacon et beaucoup de poivre noir.', '2023-05-22', 'pâtes, italien, carbonara, bacon, œufs, fromage', 'spaghetti, bacon, oeufs, parmesan, poivre noir', 'Pour préparer des spaghetti Carbonara, commencez par faire cuire des spaghetti dans une casserole d''eau salée jusqu''à ce qu''ils soient al dente. Pendant ce temps, faites revenir des lardons ou du bacon dans une poêle jusqu''à ce qu''ils soient croustillants et dorés. Dans un bol à part, mélangez des jaunes d''œufs avec du fromage râpé, comme du parmesan, et du poivre noir fraîchement moulu. Une fois que les pâtes sont cuites, égouttez-les et ajoutez-les à la poêle avec le bacon. Retirez la poêle du feu, puis versez le mélange d''œufs et de fromage sur les pâtes chaudes. Mélangez rapidement pour enrober les pâtes de la sauce crémeuse, en veillant à ne pas cuire les œufs. Ajoutez du poivre noir supplémentaire et du fromage râpé avant de servir ce plat classique de la cuisine italienne.');
INSERT INTO wikDB.recipe (recipe_id, recipe_title, recipe_author, recipe_illustration, recipe_desc, recipe_date, recipe_keyword, recipe_ingredient, recipe_instruction) VALUES (12, 'Soupe miso', 'emilyjones92', , 'Une soupe japonaise traditionnelle à base de pâte de soja fermentée et garnie de tofu et d''algues.', '2023-05-22', 'japonais, soupe, miso, tofu, algues', 'miso, tofu, algues, oignon vert', 'Pour préparer une soupe miso, commencez par faire chauffer du bouillon dashi (un bouillon de poisson japonais) dans une casserole. Ajoutez de la pâte de miso, une pâte fermentée à base de soja, dans le bouillon chaud et remuez pour la dissoudre. Ensuite, personnalisez votre soupe en ajoutant des ingrédients de votre choix, tels que des cubes de tofu, des algues wakame réhydratées, des champignons ou des légumes coupés en julienne. Laissez mijoter la soupe pendant quelques minutes jusqu''à ce que les ingrédients soient cuits et que les saveurs se mélangent harmonieusement. Juste avant de servir, garnissez la soupe de ciboule ou de coriandre fraîche pour ajouter une touche de fraîcheur. Vous pouvez accompagner cette soupe miso d''un bol de riz blanc ou de nouilles soba pour un repas japonais réconfortant et équilibré.');
